//   userAge: 34,
//   userGender: 'Male',
//   userCountry: 'Russia',
//  }
//  setVideo(obj)



  return (
    <>
        <div className='container'>



      {data.map(video => {

        return <Video
        id={video.id}
        key={video.id}
        title={video.title}
        channelName={video.channelName}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>

      })}
      <AddVideo VideoAdd={VideoAdd}></AddVideo>
    </div>

    </>


  );
}

export default App;
